<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Spacehey Layout Editor - Stamps</title>
</head>

<style>
    *{margin: 0; padding: 0;}
    body{
        background: #333;
        display: flex;
        flex-direction: column;
        justify-content: center;
        align-items: center;
    }
    .image-container {
        display: flex;
        flex-wrap: wrap;
        padding: 5px;
        gap: 5px;
        width: 1040px;
        background: #333;
    }

    .image-container img {
        display: none;
    }

    .page-navigation {
        width: 1040px;
        display: flex;
        justify-content: center;
        align-items: center;
        padding: 10px 0;
        background: #333;
        color: #FFF;
    }

    .page-button {
        margin: 0 5px;
        cursor: pointer;
        padding: 5px;
    }

    #imagesPerPage {
        width: 25px;
        float: left;
        height: 15px;
        margin: 5px;
    }
</style>

<body>


    <div id="pageNavigation" class="page-navigation">
        <button id="prevPage" class="page-button" disabled>Previous Page</button>
        <button id="nextPage" class="page-button">Next Page</button>
        <p>Page: <span id="currentPage"></span>/<span id="totalPages"></span></p>
        <p id="count" style="padding: 0 0 0 10px;">Current count: _count</p>
    </div>

<script>
    var imagesPerPage = 100;
    let currentPage = 1;

    const imageContainer = document.getElementById('imageContainer');
    const images = Array.from(imageContainer.querySelectorAll('img'));
    const totalPages = Math.ceil(images.length / imagesPerPage);

    const prevPageButton = document.getElementById('prevPage');
    const nextPageButton = document.getElementById('nextPage');


    document.getElementById("totalPages").innerText = totalPages;

    function updateButtons() {
        prevPageButton.disabled = currentPage === 1;
        nextPageButton.disabled = currentPage === totalPages;
    }

    function showImages() {
        const startIndex = (currentPage - 1) * imagesPerPage;
        const endIndex = startIndex + imagesPerPage;

        document.getElementById("currentPage").innerText = currentPage;

        images.forEach((image, index) => {
            if (index >= startIndex && index < endIndex) {
                image.style.display = 'block';
            } else {
                image.style.display = 'none';
            }
        });

        updateButtons();
    }

    document.getElementById('nextPage').addEventListener('click', () => {
        if (currentPage < totalPages) {
            currentPage++;
            showImages();
        }
    });

    document.getElementById('prevPage').addEventListener('click', () => {
        if (currentPage > 1) {
            currentPage--;
            showImages();
        }
    });

    // Initial display
    showImages();

    var im = document.getElementsByTagName("img");
    var ct = document.getElementById("count");
    ct.innerText = ct.innerText.replace("_count", im.length);
</script>

</html>
